    /**
     * The access token for authentication and authorization.
     */
    accessToken: string

    /**
     * The refresh token for obtaining a new access token when the current one expires.
     */
    refreshToken: string
}

export interface UserLogin {
    /**
     * The user's username (email address).
     */
    username: string

    /**
     * The user's password for authentication.
     */
    password: string
}

export interface UserToken {
    /**
     * The "sub" field typically represents the subject of the JWT, such as a username or email address.
     */
    sub: string

    /**
     * The "exp" field represents the expiration date of the JWT as a number (timestamp).
     */
    exp: number

    /**
     * The "iat" field represents the creation date of the JWT as a number (timestamp).
     */
    iat: number
}

